={{ (() => {
  let content = {};
  try {
    content = JSON.parse($json.message?.content || "{}");
  } catch (e) {
    content = {};
  }

  return {
    email: $json.email,
    classification: content.override_classification || $json.analysis?.final_classification || "UNKNOWN",
    reasoning_summary: content.reasoning || "No reasoning available",
    confidence: content.final_confidence ?? $json.analysis?.multi_factor_analysis?.confidence_score ?? 0.5,
    source: "skeptical_review",
    review_depth: "EXTENDED"
  };
})() }}

={{ (() => {
  return {
    submissions: $input.all().map(item => ({
      email_id: item.json?.email?.id || "unknown_id",
      sender: item.json?.email?.sender || "unknown_sender",
      classification: item.json?.classification || "UNCLASSIFIED",
      reasoning_summary: item.json?.reasoning_summary || "No reasoning provided",
      confidence: item.json?.confidence ?? 0.5
    }))
  };
})() }}

